script: |
  super -f text -I q5145.spq | sort > q5145.out

inputs:
  - name: q5145.spq
    data: |
      SELECT DISTINCT 25 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet), tab0 (FORMAT parquet) cor1, tab1 (FORMAT parquet) AS cor2, tab0 (FORMAT parquet) AS cor3;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q5145.out
    data: |
      25
